import React, { Component } from 'react';
import SideMenu from './side-menu';
import CovidCarrierStatus from './covid-carrier-status';
import CovidCarrierNumber from './covid-carrier-number';
import CovidTestedNumber from './covid-tested-number';
import CovidPatientData from './covid-patient-data';
import CovidNewsList from './covid-news';
import CovidAdviceCenter from './covid-advice-center';
import CovidCallCenter from './covid-call-center';
import Drawer from './drawer';
import Footer from './footer';

function App() {
  const style = {
    margin: "15px auto 0 auto",
    fontSize: "200%",
  };
  return (
    <div className="container-fluid">
      <div className="container">
        <div>
          <Drawer />
        </div>
        <div className="row">
          <div className="col-12 col-md-4 col-lg-3 position-fixed my-3">
            <div className="nav flex-nowrap vh-100 overflow-auto p-2 d-none d-md-block">
              <SideMenu />
            </div>
          </div>
          <div className="col-12 offset-md-4 offset-lg-3 col-md-8 col-lg-9 my-3">
            <div className="row">
              <div className="col-12 col-lg-12">
                <CovidNewsList />
              </div>
              <div className="col-12 col-lg-6">
                <CovidCarrierNumber />
              </div>
              <div className="col-12 col-lg-6">
                <CovidTestedNumber />
              </div>
              <div className="col-12 col-lg-12">
                <CovidCarrierStatus />
              </div>
              <div className="col-12 col-lg-12">
                <CovidPatientData />
              </div>
              <div className="col-12 col-lg-6">
                <CovidAdviceCenter />
              </div>
              <div className="col-12 col-lg-6">
                <CovidCallCenter />
              </div>

              <iframe src="https://e.infogram.com/ba9944f3-2ecf-4f77-8f90-8203cd3663af?src=embed" title="ワクチン接種数（県別）" width="700" height="1220" scrolling="no" frameborder="0" allowfullscreen="allowfullscreen"></iframe><div><a href="https://infogram.com/ba9944f3-2ecf-4f77-8f90-8203cd3663af" target="_blank">ワクチン接種数（県別）</a><br /><a href="https://infogram.com" target="_blank" rel="nofollow">Infogram</a></div>

            </div>
          </div>
        </div>
        <Footer />
      </div>
    </div>
  );
}

export default App;
